import { students } from "./data";

function App() {


  return (

    <>
      <div className="container my-5">
        <div className="row justify-content-center">

          {
            students.map( (data,index)=> 
              <div className="col-md-3">
                <div className="card shadow">
                  <div className="card-body">
                    <h2>{data.name}</h2>
                    <p>{data.skill}</p>
                    <p>{data.age}</p>
                    <h1>{index}</h1>

                  </div>

                </div>
              </div>
              )
          }


        </div>
      </div>


    </>

  );
}

export default App;
